import React, { useState, useEffect } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAlignCenter, faCoffee, faFaceMehBlank } from '@fortawesome/free-solid-svg-icons';
import logo from '../../logo.svg'; // Adjust the path accordingly
import './Home.css';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  const [selectedOption1, setSelectedOption1] = useState('');
  const [selectedOption2, setSelectedOption2] = useState('');
  const [options2, setOptions2] = useState([]);
  const [formSubmitted, setFormSubmitted] = useState(false);

  // Sample data for options
  const dynamicOptions1 = [
    { value: 'option1a', label: 'Option 1A' },
    { value: 'option1b', label: 'Option 1B' },
    { value: 'option1c', label: 'Option 1C' },
  ];

  const dynamicOptions2 = {
    option1a: [
      { value: 'option2a1', label: 'Option 2A1' },
      { value: 'option2a2', label: 'Option 2A2' },
    ],
    option1b: [
      { value: 'option2b1', label: 'Option 2B1' },
      { value: 'option2b2', label: 'Option 2B2' },
    ],
    option1c: [
      { value: 'option2c1', label: 'Option 2C1' },
      { value: 'option2c2', label: 'Option 2C2' },
    ],
  };

  useEffect(() => {
    // Update options of Dropdown 2 based on the selected value of Dropdown 1
    setOptions2(dynamicOptions2[selectedOption1] || []);
    // Reset selected value of Dropdown 2
    setSelectedOption2('');
  }, [selectedOption1]);

  const handleOption1Change = (event) => {
    setSelectedOption1(event.target.value);
  };

  const handleOption2Change = (event) => {
    setSelectedOption2(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    if(selectedOption1=='' || selectedOption2=='')
    return;
    // Perform actions with selected options, e.g., submit to a server
    console.log('Selected Option 1:', selectedOption1);
    console.log('Selected Option 2:', selectedOption2);

    navigate('/project-list');
  };

  return (
    <>
      <header className='header'>
        <div className='header-logo'>
          <h2>Project Vault</h2>
        </div>
        <div className='header-nav-elements'>
          <a href="#">
            <div>Home</div>
          </a>
          <a href="#">
            <div>About</div>
          </a>
          <a href="#">
            <div>Contact</div>
          </a>
          <a href="#">
            <div>
              <FontAwesomeIcon icon={faFaceMehBlank} className='icon' />
            </div>
          </a>
        </div>
      </header>

      <div className='body-div'>
        <div>
          <h1>Welcome to Project Vault</h1>
          <p>Explore the perfect projects for your academic requirements, with all source codes, reports, included</p>
        </div>
        
        <form onSubmit={handleSubmit}>
          <div className='dropdown'>
            {/* <select className='dropdown-box' value={selectedOption1} onChange={handleOption1Change}> */}
            <select className={`dropdown-box${formSubmitted && selectedOption2 === '' ? '-error' : ''}`} value={selectedOption1} onChange={handleOption1Change}>
              <option value=''>Select Option 1</option>
              {dynamicOptions1.map((option) => (
                <option key={option.value} value={option.value}>
                  {option.label}
                </option>
              ))}
            </select>
          </div>

          <div className='dropdown'>
            <select className='dropdown-box' value={selectedOption2} onChange={handleOption2Change}>
              <option value=''>Select Option 2</option>
              {options2.map((option) => (
                <option key={option.value} value={option.value}>
                  {option.label}
                </option>
              ))}
            </select>
          </div>

          <button type='submit'>Search Projects</button>
        </form>
      </div>
    </>
  );
}

export default Home;
